import Navbar from "./Navbar";
import Head from "next/head";

const Layout = (props) => (
    <div>
        <Head>
            <title>My Bit coin app</title>
            <link/>
        </Head>
        <Navbar/>
        {props.children}
    </div>
    );
export default Layout;
